import React from 'react';
import styled from 'styled-components';
import StarIcon from '@material-ui/icons/Star';

const RatingContainer = styled.div`
  position: relative;
  border-radius: 10px;
  width: 150px;
  margin: 0 auto;
  background-color: red;
`;
const RatingSymbol = styled.div`
  background-color: white;
  color: black;
  font-size: 10vw;
  font-weight: bold;
  margin: 0 auto;
  padding: 10px;
  width: 50%;
  text-align: center;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  mix-blend-mode: screen;
`;
const symbolMap = {
  star: '&#9733;',
};
function Rating() {
  return (
    <RatingContainer>
      <RatingSymbol>
        {[1, 2, 3, 4, 5].map((symbol) => (
          <StarIcon />
        ))}
      </RatingSymbol>
    </RatingContainer>
  );
}

export default Rating;
